script: |
  super -f text -I q5256.spq | sort > q5256.out

inputs:
  - name: q5256.spq
    data: |
      SELECT DISTINCT * FROM tab1 (FORMAT parquet) AS cor0 WHERE NOT - col0 + + col0 * + + col0 NOT IN ( - - col1 * - col1 * + - col2 + - col0, + col0 + CAST ( NULL AS INTEGER ) + + col0 + col1 * - col1 );
  - name: tab1

outputs:
  - name: q5256.out
    data: |
